response.about:
Личные качества
креативность, творческое мышление;
коммуникабельность; 
гибкость мышления;
чувство гармонии, стиля и безупречный вкус;
организаторские способности;
ответственность;
развитая интуиция;
аналитические способности;
хорошая образная память;
внимательность, аккуратность;
терпеливость, выдержка и умение сосредоточиться на одном объекте;
тактичность;
доброжелательность.
Обладаю всеми необходимыми профессиональными навыками и знаниями: знание истории моды, ее канонов, традиций и тенденций развития;
владение основами стилистики и колористики;
умение правильно наносить макияж, подбирать одежду;
знание парикмахерского искусства;
умение сопоставлять зрительный образ с внутренней сущностью человека;
развитое воображение, хорошая зрительная память;
умение подбирать образ под характер клиента;
знание основ психологии;
художественные навыки.
